        {id:1,name:"keanu",surname:"reeves",src:"https://icons-for-free.com/iconfiles/png/512/heart-131965017458786724.png"},
        {   id:Date.now(),
            name:"bakuri",
            surname:"kokhodze",
            src:"https://icons-for-free.com/iconfiles/png/512/heart-131965017458786724.png"
        },
    ])
return(
    <div>
        <Post statepost={statepost}/>
    </div>
)}

export default Myposts
